IF OBJECT_ID('dbo.proc_transform_295', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_295;
GO
CREATE PROCEDURE dbo.proc_transform_295
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_295
    SET payload = LEFT(payload, 1000) + N'|V4-295|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_295;
END
GO
IF OBJECT_ID('dbo.audit_v4_295', 'U') IS NULL
